import React from 'react';

function Header() {
  const handleLogout = () => {
    // Add your logout logic here, like clearing tokens or redirecting to login page
    console.log('User logged out');
    alert('You have been logged out');
  };

  return (
    <header id="page-topbar">
      <div className="navbar-header">
        <div className="d-flex">
          {/* LOGO */}
          <div className="navbar-brand-box">
            <a href="index.html" className="logo logo-dark">
              <span className="logo-sm">
                <img src="assets/images/logo-light.png" alt="Logo" height={22} />
              </span>
              <span className="logo-lg">
                <img src="assets/images/logo-light.png" alt="Logo" height={20} />
              </span>
            </a>
            <a href="index.html" className="logo logo-light">
              <span className="logo-sm">
                <img src="assets/images/logo-light.png" alt="Logo" height={22} />
              </span>
              <span className="logo-lg">
                <img src="assets/images/logo-light.png" alt="Logo" height={20} />
              </span>
            </a>
          </div>
        </div>

        <div className="d-flex">
          {/* Notification Icon */}
          <button
            type="button"
            className="btn header-item noti-icon waves-effect"
            id="page-header-notifications-dropdown"
            data-bs-toggle="dropdown"
            aria-haspopup="true"
            aria-expanded="false"
          >
            <i className="mdi mdi-bell-outline bx-tada" />
            <span className="badge bg-danger rounded-pill">3</span>
          </button>

          {/* Logout Button */}
          <a
            href="#"
            className="btn header-item text-danger d-flex align-items-center"
            onClick={(e) => {
              e.preventDefault();
              handleLogout(); // Call logout function on click
            }}
          >
            <i className="mdi mdi-power font-size-16 align-middle me-1 text-danger"></i> Logout
          </a>
        </div>
      </div>
    </header>
  );
}

export default Header;
